🌟 Trickline Master World Championship 2024 🌟

On May 31 and June 1, the city of Stuttgart, Germany, hosted the Keszel Festival, featuring the thrilling Trickline World Cup! The event featured the highest-level athletes from around the world.
 🌍✨

Men's Results:
🥇 1st place: Rikuto Nakamura (Japan) - Maintained his champion title.
🥈 2nd place: Shin Kikukawa (Japan)
🥉 3rd place: Eishin Hayashi (Japan)

These athletes showcased their skills against world-class competitors such as Brazilians Alisson Ferreira and Darllyon Araújo, Chilean Abraham Hernandez, as well as representatives from Germany, France, Spain, Portugal, Italy, Argentina, among others.
 🌎🔥

Women's Results:
🥇 1st place: Mao Takebe (Japan) - Continued as champion.
🥈 2nd place: Mirai Kuwabara (Japan) - A young talent who surprised this year.
🥉 3rd place: Akari Sasaki (Japan)

The Japanese competitors faced and shared the stage with outstanding athletes such as Giada Regoli from Italy and Giovanna Petrucci from Brazil, among others. 🌟💪

Each of these participants demonstrated that year after year they surpass the threshold of balance, movement, and control on the line, regardless of the rainy weather during the competition days. Extreme maneuvers such as triple mortal spins combined with 720-degree spins, double backflips landed on their feet, and more were performed on a 28-meter-long line, 2 meters above the airbag.  🌧️🤸‍♂️

This year, the Japanese representatives took all podium positions in both the men's and women's categories, showcasing their skill in extreme maneuvers. This will be reflected in the International Slackline Association's world ranking in the World Cup category.  🏆🇯🇵

